// src/components/Home/HomePage.js

import React from 'react';
import Navbar from '../Common/Navbar';
import Footer from '../Common/Footer';
import HeaderBar from '../Common/HeaderBar';
import HeroSection from './HeroSection'; // Importing HeroSection
import './HomePage.css';

const HomePage = () => {
    return (
        <div className="home-page">
            <HeaderBar />
            <Navbar />
            {/* Hero Section */}
            <HeroSection />
            <div className="home-content">
                <section className="intro">
                    <h1>Welcome to HealthConnect</h1>
                    <p>
                        Your one-stop solution to predict diseases, connect with health professionals, 
                        and access reliable medical resources.
                    </p>
                </section>
            </div>
            <Footer />
        </div>
    );
};

export default HomePage;
